script: |
  super -f text -I q336.spq | sort > q336.out

inputs:
  - name: q336.spq
    data: |
      SELECT ALL + col0 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT - col0 NOT BETWEEN 17 * col2 - 44 - + 31 + + col2 + - + col0 + + col2 * col1 AND + ( 96 );
  - name: tab2

outputs:
  - name: q336.out
    data: |
